import React from 'react';
import { Link } from 'react-router-dom';

//Material UI components

export default class Product extends React.Component {

    render() {
        const { id, url, desc, shop } = this.props;
        return (
            <div>
                <Link to={`/product/${id}`}>
                    <img className={`img-${id}`} src={url} />
                </Link>
            </div>
        );
    }
}
